import {MyNav, MyFooter} from './component/myfile';
import {Container} from 'react-bootstrap'
import FantasyBooks from './component/GetJson';


function App() {
  return (
    <>    
    <div>
      <MyNav/>
    </div>
    <div className="App">

      <Container>
    <FantasyBooks/>
      </Container>

      <footer>
        <MyFooter/>
      </footer>
    </div>
    </>

  );
}

export default App;
